  - name: TEXT4000
    number: '4'
    value: 'Re: letter of 09/07/05. The discrepancies between disbursement totals
      on the 7/31/05 uploaded report and the 8/19/05 uploaded amendment were due to
      the following: 07/31/05 disclosed disbursements of $1012.07 and $347.23 that
      should have been memo entries and a duplicate entry in the amount of $5657.17.
      On the 08/19/05 amendment a $5657.17 disbursement was inadvertently left out.
      Additionally'
  - name: AMENDED CD
    number: '5'
    value: ' there were two $0.01 discrepancies on ADP payrolls on 05/25/05 and 06/15/05.
      The total of these changes equals $11'
  - value: '979.20. The discrepancies between receipt totals on the 7/31/05 uploaded
      report and the 8/19/05 uploaded amendment were due to the following: 07/31/05
      disclosed $33009.93 in receipts for which we were unable to verify documentation.
      These receipts were returned. The remaining discrepancy of $3794.59 was due
      to an importation error in which some receipts were imported twice. This was
      the corruption of our database that caused us to recreate the database as noted
      in the memo text attached to the 8/19/05 amendment. These numbers added together
      equal the $36804.52 discrepancy between the two uploads.  Re: Item 3 of your
      letter of 9/7/05:   The New York City CLC is not a political action committee.  It
      is a Central Labor Council'
  - value: ' the local chapter of the AFL-CIO. CONTINUED ON MEMO TEXT ATTACHED TO
      ID 131318'
